import UniPCSS from './UniversityPage.module.css'
// import Rate from '../Components/Rate';

function UniversityPage(){
    return(
        <div class ={UniPCSS.UniPageBody}>
            <div class={UniPCSS.UniDetailsContainer}>
                <div> <h1 class={UniPCSS.UniTitle}> UNIVERSITY TITLE</h1></div>
                <div> <p class={UniPCSS.Description}>University desciption</p></div>
                {/*properties*/}
                <div> <p>Email: </p>  </div>
                <div> <p>Telefon Numarası: </p></div>
                <div> <p>Şehir:  </p></div>
                <div> <p>Rektör: </p></div>
                <div> <p>Sıralama </p></div>
                <div> RATE</div>
            </div>

            <div class="add-comment">
                {/* <p><Rate/></p> */}
                <div class="form-group">
					<input type="text" class="form-style" placeholder="Yorum" required/>
				</div>	
            </div>
        </div>
    );
}

export default UniversityPage;
